import React from 'react';

import yanis from './../../src/yanis.png';
import 'aos/dist/aos.css';
const Footer =({}) =>{

    return (
        <>
         <diV className="bas">
             <div className="text">
                 <p></p>
                 <p></p>

                 <h3>Resaux sociaux</h3>
                 <div>Icônes conçues par <a href="https://www.flaticon.com/fr/auteurs/pixel-buddha" title="Pixel Buddha">Pixel Buddha</a> from <a href="https://www.flaticon.com/fr/" title="Flaticon">www.flaticon.com</a></div>


             </div>
             


         </diV>

        </>
    )};
    export default Footer;
